using System;
using System.Threading;
using System.Threading.Tasks;
using FluentAssertions;
using ManageATenancyAPI.Gateways.SaveMeeting.SaveEtraMeetingSignOffMeeting;
using ManageATenancyAPI.UseCases.Meeting.SaveMeeting.Boundary;
using ManageATenancyAPI.UseCases.Meeting.SignOffMeeting;
using ManageATenancyAPI.UseCases.Meeting.SignOffMeeting.Boundary;
using Moq;
using Xunit;

namespace ManageATenancyAPI.Tests.v2.UseCases.SignOffMeeting
{
    public class SignOffMeetingUseCaseTests
    {
        private ISignOffMeetingUseCase _classUnderTest;
        private Mock<ISaveEtraMeetingSignOffMeetingGateway> _mockGateway;
        public SignOffMeetingUseCaseTests()
        {
            _mockGateway = new Mock<ISaveEtraMeetingSignOffMeetingGateway>();
            _classUnderTest = new SignOffMeetingUseCase(_mockGateway.Object);
        }

        [Theory]
        [InlineData(1, "Jeff", "chair", "")]
        [InlineData(2, "Jeff", "secretary", "")]
        public async Task calls_gateway(int attendees, string name, string role, string signature)
        { 
           
            //arrange
            var meetingId = Guid.NewGuid();

            var singOffMeetingInputModel = new SignOffMeetingInputModel
            {
                MeetingId = meetingId,
                SignOff = new SignOff
                {
                    Name = name,
                    Role = role,
                    Signature = signature
                }
            };
            _mockGateway.Setup(s => s.SignOffMeetingAsync(
                It.Is<Guid>(m => m == meetingId),
                It.Is<SignOff>(m => m.Name.Equals(name) && m.Role.Equals(role) && m.Signature.Equals(signature)),
                It.IsAny<CancellationToken>())).ReturnsAsync(new SignOffMeetingOutputModel
            {
                Id = meetingId,
                SignOff = singOffMeetingInputModel.SignOff,
                IsSignedOff = true
            });
            //act
            await _classUnderTest.ExecuteAsync(singOffMeetingInputModel, CancellationToken.None).ConfigureAwait(false);
            //assert
            _mockGateway.Verify(s => s.SignOffMeetingAsync(It.Is<Guid>(m => m == meetingId), 
                It.Is<SignOff>(m => m.Name.Equals(name) && m.Role.Equals(role) && m.Signature.Equals(signature)),
                It.IsAny<CancellationToken>()), Times.Once);
        }

        [Theory]
        [InlineData(1, "Jeff", "chair", "")]
        [InlineData(2, "Jeff", "secretary", "")]
        public async Task returns_output_model(int attendees, string name, string role, string signature)
        {

            //arrange
            var meetingId = Guid.NewGuid();

            var singOffMeetingInputModel = new SignOffMeetingInputModel
            {
                MeetingId = meetingId,
                SignOff = new SignOff
                {
                    Name = name,
                    Role = role,
                    Signature = signature
                }
            };
            var expectedOutputModel = new SignOffMeetingOutputModel
            {
                Id = meetingId,
                SignOff = singOffMeetingInputModel.SignOff,
                IsSignedOff = true
            };
            _mockGateway.Setup(s => s.SignOffMeetingAsync(
                It.Is<Guid>(m => m == meetingId),
                It.Is<SignOff>(m => m.Name.Equals(name) && m.Role.Equals(role) && m.Signature.Equals(signature)),
                It.IsAny<CancellationToken>())).ReturnsAsync(expectedOutputModel);
            //act
            var outputModel = await _classUnderTest.ExecuteAsync(singOffMeetingInputModel, CancellationToken.None).ConfigureAwait(false);
            //assert
            outputModel.Should().NotBeNull();
            outputModel.Should().BeEquivalentTo(expectedOutputModel);
        }
    }
}